import Card from "../UI/Card";


const ShowUser = (props) => {
  return (
    <Card>
      <ul>
        {props.users.map((user) => (
          <li>
            {user.id} {user.username} ({user.age})
          </li>
        ))}
      </ul>
    </Card>
  );
};

export default ShowUser;
